import { useState } from "react";
import { useNavigate } from "react-router-dom";

function Register() {
  const [fullName, setFullName] = useState("");
  const [rollNumber, setRollNumber] = useState("");
  const [branch, setBranch] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("student"); // default role
  const navigate = useNavigate();

  const handleRegister = (e) => {
    e.preventDefault();

    // Save user details in localStorage
    localStorage.setItem(
      "user",
      JSON.stringify({ fullName, rollNumber, branch, email, password, role })
    );

    alert("Registration successful!");
    navigate("/");
  };

  return (
    <div className="d-flex justify-content-center align-items-center vh-100 bg-light">
      <form
        onSubmit={handleRegister}
        className="bg-white shadow-lg rounded p-4"
        style={{ width: "28rem" }}
      >
        <h2 className="text-center mb-4 fw-bold text-primary">Register</h2>

        {/* Full Name */}
        <div className="mb-3">
          <label className="form-label fw-semibold">Full Name</label>
          <input
            type="text"
            className="form-control"
            placeholder="Enter your full name"
            value={fullName}
            onChange={(e) => setFullName(e.target.value)}
            required
          />
        </div>

        {/* Roll Number */}
        <div className="mb-3">
          <label className="form-label fw-semibold">Roll Number</label>
          <input
            type="text"
            className="form-control"
            placeholder="Enter your roll number"
            value={rollNumber}
            onChange={(e) => setRollNumber(e.target.value)}
            required
          />
        </div>

        {/* Branch */}
        <div className="mb-3">
          <label className="form-label fw-semibold">Branch</label>
          <input
            type="text"
            className="form-control"
            placeholder="Enter your branch"
            value={branch}
            onChange={(e) => setBranch(e.target.value)}
            required
          />
        </div>

        {/* Email */}
        <div className="mb-3">
          <label className="form-label fw-semibold">Email</label>
          <input
            type="email"
            className="form-control"
            placeholder="Enter your college email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>

        {/* Password */}
        <div className="mb-3">
          <label className="form-label fw-semibold">Password</label>
          <input
            type="password"
            className="form-control"
            placeholder="Enter your password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>

        {/* Role */}
        <div className="mb-3">
          <label className="form-label fw-semibold">Role</label>
          <select
            className="form-select"
            value={role}
            onChange={(e) => setRole(e.target.value)}
          >
            <option value="student">Student</option>
            <option value="organizer">Organizer</option>
            <option value="admin">Admin</option>
          </select>
        </div>

        {/* Submit Button */}
        <button type="submit" className="btn btn-primary w-100 py-2 fw-semibold">
          Register
        </button>

        {/* Redirect to Login */}
        <p className="text-center mt-3 mb-0">
          Already have an account?{" "}
          <a href="/" className="text-primary fw-semibold">
            Login
          </a>
        </p>
      </form>
    </div>
  );
}

export default Register;
